  [],\n\t\"revision_timestamp\": \"2016-11-15T20:04:53.191764\",\n\t\"name\": \"review-of-sops-for-prodcutivity-surveys-for-ep-tundra-swans\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report reviews the SOPs for productivity
  surveys of tundra swans to identify areas of improvement. An average of 18,700 swans
  has been surveyed in the Atlantic Flyway each year over the last 5 years. This equates
  to approximately 21% of the total EP tundra swan population based on the current
  3 year average population of 88K. Annual sampling allocation by state is not readily
  available from current reports, but earlier reports suggest that sampling is not
  in proportion to the wintering distribution in the Atlantic Flyway. It is not known
  whether a proportional allocation of surveyed swans based on the mid-winter distribution
  is desired or needed. If immature and adult swans distribute themselves equitably
  within the flyway, a formal allocation of sampling is not needed. Absent the knowledge
  of wintering family group distribution, a more formal allocation may be desired.
  Includes surveys from Pocosin Lakes National Wildlife Refuge.\",\n\t\"license_title\":
